import React from "react"

function CardSelection(props) {
    let cardList = props.list.map((item, index) => {
        return (<p key={index} onClick={() => props.handleClick(index)} className={props.checkedArtists.length && props.checkedArtists[index] ? "checked" : null}>{item}</p>)
    })

    return (
        <>
            {cardList}
        </>
    )
}

export default CardSelection;
